jb.ns('facebook')

jb.component('facebook.main', { /* facebook.main */
  type: 'control',
  impl: group({
    controls: [
      button({
        title: 'parse',
        action: writeValue('%$All_Posts%', pipeline('%$gantz%', facebook.fbPageParser()))
      }),
      button({
        title: 'http get',
        action: writeValueAsynch(
          '%$table%',
          pipe(
            '%$All_Posts%',
            http.get('%%'),
            obj(
                prop(
                    'post-text',
                    extractText({
                      startMarkers: ['class=\"_5pbx userContent _3ds9 _3576\"', '<p>'],
                      endMarker: '</p>'
                    })
                  ),
                prop(
                    'username',
                    extractText({
                      startMarkers: ['class=\"_50f3 _50f7', ' aria-owns=\"\">'],
                      endMarker: '<'
                    })
                  ),
                prop(
                    'number-of-likes',
                    pipeline(
                      extractText({
                          startMarkers: ['class=\"_81hb\"', '>'],
                          endMarker: '</span>',
                          repeating: 'true'
                        }),
                      filter(matchRegex('[0-9MK.]*')),
                      replace({find: '.', useRegex: 'false'}),
                      replace({find: 'K', replace: '000'})
                    )
                  )
              )
          )
        )
      }),
      label('hi')
    ]
  })
})

jb.component('facebook.fb-page-parser', { /* facebook.fbPageParser */
  type: 'data',
  impl: pipeline(
    extractText({startMarkers: 'class=\"_50f8 _50f4\"'}),
    extractText({startMarkers: 'class=\"_4-u2 _4-u8\"', repeating: 'true'}),
    extractText({
        startMarkers: ['class=\"_3hg- _42ft\"', 'href=\"'],
        endMarker: '\"'
      })
  ),
  testData: '%$gantz%'
})

